import logoImage from '../assets/images/logo.png';

const Header = () => {
	return (
		<div class="header">
		   <div class="top-header">
		      <div class="pizza-logo">
		         <img class="brand-logo" src="/assets/images/logo.png" alt="pizza store logo" />
		      </div>
            </div>
         </div>
	);
};

export default Header;
